precision mediump float;
uniform float _W;
uniform float _H;
uniform sampler2D X0;
uniform sampler2D X1;

void main() {
  float x = (gl_FragCoord.x - 0.5) / _W;
  float y = (gl_FragCoord.y - 0.5) / _H;

  gl_FragColor = vec4(texture2D(X0, vec2(x, y)).r * texture2D(X1, vec2(x, y)).r, 0, 0, 0);
}

